import React, {Component} from 'react';
import {connect} from 'react-redux';
import {fetchFoods} from '../../store/actions/foods'
import SearchBar from '../../components/PlanAlimenticio/SearchBar'

class PlanAlimenticio extends Component{
  render(){
    const {foods}=this.props
    return(
      <div>
        <SearchBar/>
        <ul>
          {foods.map(function(food, key){
            return <div key={key}>
            <table>
              <tr>
                <th>Nombre</th>
                <th>Calorias</th>
                <th>Proteinas</th>
                <th>Carbohidratos</th>
                <th>Grasas</th>
              </tr>
            </table>
            <li>{food.foodName}</li><ul><li>Proteina:{food.protein_g}</li><li> 
            Carbs: {food.carbs_g}</li></ul></div>
          })}
        </ul>
      </div>
      )
  }
}

function mapStateToProps(state){
  return{
    foods: state.foods,
    currentUserId: state.currentUser.user.id
  };
};

export default connect(mapStateToProps, {fetchFoods})(PlanAlimenticio);
